import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

// Sponsor Form Component
function SponsorForm() {
  const [sponsorData, setSponsorData] = useState({
    sponsor_name: '', sponsor_phone: '', farmer_name: '', amount: '', crop: '', quantity: ''
  });

  const handleChange = (e) => {
    setSponsorData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/sponsorship/sponsor/', sponsorData);
      console.log('Success:', response.data);
      alert('Sponsorship created!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div>
      <h2>Create Sponsorship</h2>
      <form onSubmit={handleSubmit}>
        <input name="sponsor_name" placeholder="Sponsor Name" value={sponsorData.sponsor_name} onChange={handleChange} />
        <input name="sponsor_phone" placeholder="Sponsor Phone" value={sponsorData.sponsor_phone} onChange={handleChange} />
        <input name="farmer_name" placeholder="Farmer Name" value={sponsorData.farmer_name} onChange={handleChange} />
        <input name="amount" type="number" placeholder="Amount" value={sponsorData.amount} onChange={handleChange} />
        <input name="crop" placeholder="Crop" value={sponsorData.crop} onChange={handleChange} />
        <input name="quantity" type="number" placeholder="Quantity" value={sponsorData.quantity} onChange={handleChange} />
        <button type="submit">Create Sponsorship</button>
      </form>
    </div>
  );
}

// Produce Form Component
function ProduceForm() {
  const [produceData, setProduceData] = useState({
    farmer_name: '', farmer_phone: '', crop: '', quantity: '', price_per_kg: ''
  });

  const handleChange = (e) => {
    setProduceData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/marketplace/list/', produceData);
      console.log('Success:', response.data);
      alert('Produce listed!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div>
      <h2>List Produce</h2>
      <form onSubmit={handleSubmit}>
        <input name="farmer_name" placeholder="Farmer Name" value={produceData.farmer_name} onChange={handleChange} />
        <input name="farmer_phone" placeholder="Farmer Phone" value={produceData.farmer_phone} onChange={handleChange} />
        <input name="crop" placeholder="Crop" value={produceData.crop} onChange={handleChange} />
        <input name="quantity" type="number" placeholder="Quantity" value={produceData.quantity} onChange={handleChange} />
        <input name="price_per_kg" type="number" placeholder="Price per kg" value={produceData.price_per_kg} onChange={handleChange} />
        <button type="submit">List Produce</button>
      </form>
    </div>
  );
}

// Buy Form Component
function BuyForm() {
  const [buyData, setBuyData] = useState({
    produce_id: '', buyer_name: '', buyer_phone: ''
  });

  const handleChange = (e) => {
    setBuyData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/marketplace/buy/', buyData);
      console.log('Success:', response.data);
      alert('Purchase completed!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div>
      <h2>Buy Produce</h2>
      <form onSubmit={handleSubmit}>
        <input name="produce_id" type="number" placeholder="Produce ID" value={buyData.produce_id} onChange={handleChange} />
        <input name="buyer_name" placeholder="Buyer Name" value={buyData.buyer_name} onChange={handleChange} />
        <input name="buyer_phone" placeholder="Buyer Phone" value={buyData.buyer_phone} onChange={handleChange} />
        <button type="submit">Buy Produce</button>
      </form>
    </div>
  );
}

// Main App with Routing
function App() {
  return (
    <Router>
      <div className="App">
        <h1>AgriTech Prototype</h1>
        <nav>
          <Link to="/sponsor">Sponsor</Link> | <Link to="/list">List Produce</Link> | <Link to="/buy">Buy Produce</Link>
        </nav>
        <Routes>
          <Route path="/sponsor" element={<SponsorForm />} />
          <Route path="/list" element={<ProduceForm />} />
          <Route path="/buy" element={<BuyForm />} />
          <Route path="/" element={<h2>Welcome! Choose an action above.</h2>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
